import React from 'react';
import { Box, Card, CardActionArea, CardMedia, CardContent, CardActions, Button } from '@material-ui/core';

export default class Apps extends React.Component {

  render() {
    return (
        <Box color="#263238" width={2/5} align="center">
          <CardActionArea>
            <CardMedia
              component="img"
              src="../image/scrumate.png"
            />
          </CardActionArea>
          <CardActions>
            <Button size="small" color="primary">
              Share
            </Button>
            <Button size="small" color="primary">
              Learn More
            </Button>
          </CardActions>
        </Box>
    );
  }
}
